import keyword


def decrypt_clue(text):
    words = [] # نیاز دارم لیستشون کنم تا آخر پروژه بتونم ازشون استفاده کنم
    kw = keyword.kwlist
    for i in kw :
        if i in text :
            words.append(i)
    return words


